import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" {...props}><path fill="#fff" d="M2 10H0v6h6v-2H2v-4zM10 0v2h4v4h2V0h-6zM0 6h2V2h4V0H0v6z" /><path className="aw-theme-iconOutline" fill="#fff" d="M14 14h-4v2h6v-6h-2v4z" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <g>    <polygon points="2 10 0 10 0 16 6 16 6 14 2 14 2 10" fill="#fff"/>    <polygon points="10 0 10 2 14 2 14 6 16 6 16 0 10 0" fill="#fff"/>    <polygon points="0 6 2 6 2 2 6 2 6 0 0 0 0 6" fill="#fff"/>    <polygon points="14 14 10 14 10 16 16 16 16 10 14 10 14 14" class="aw-theme-iconOutline" fill="#fff"/>  </g></svg>';
        export const SvgComponent = React.memo(SvgComp);
